import React from "react";
import { Link } from "react-router-dom";

function HomePage() {
    return (
        <div>
            <div className="hero">
                <div className="text">

                    <center className="position-absolute top-50 start-50 translate-middle-x">
                    <h2>Welcome to ChaTikka</h2>
                    <Link className="btn btn-primary" role="button" aria-disabled="true">Primary link</Link>
                    <form className="d-flex">
                        <input className="form-control me-3" type="search" placeholder="Find a pet...." aria-label="Search"/>
                        <button className="btn btn-outline-light" type="submit"><strong>Search</strong></button>
                    </form>
                    </center>
                </div>
            </div>
        </div>
    );
}

export default HomePage;
